import React from "react";
const Skills = () => {
    return (
        <section id = "skills" className="skills">
            <PageHeaderContent
                headerText="My Skills "
                icon={<BsInfoCircleFill size={40}/>}
            />
        </section>
    );
}
export default Skills;
